import React, { Component } from 'react';
import { StyleSheet, Text, View, TextInput, ScrollView, TouchableOpacity, Button } from 'react-native';
import axios from 'axios';

export default class JoinAWedding extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <View style={styles.container}>
          <Text>Join A Wedding</Text>
          <TextInput
            placeholder="Enter invite code here"
          ></TextInput>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  container: {
    marginHorizontal: 20,
    marginTop: 40,
    marginBottom: 10,
  },

  heading: {
    fontSize: 20,
    fontWeight: "bold",
  },

  input: {
    borderWidth: 2,
    borderColor: "black",
    width: "60%"
  },

  button: {
    // alignItems: "center",
    justifyContent: "center",
    width: "30%",
    height: 30,
    backgroundColor: "#980007",
  },

  buttonText: {
    color: "white",
  },
})
